instance.peoplecode_text:
/**
* Gets/Sets Course Exchange Financial Aid Units into/from a staging table
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_FinancialAidUnits
   method CCTC_FinancialAidUnits();

   method getList(&bindVars As array of any) Returns array of array of any;

   method getStudentUnits(&bindVars As array of any) Returns array of array of any;

   method setStudentUnits(&bindVars As array of any) Returns array of array of any;

   method removeStudentUnits(&bindVars As array of any) Returns array of array of any;

end-class;

method CCTC_FinancialAidUnits
   rem do nothing;
end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve Course Exchange FA Unit data from a staging table
* 
* @param &bindVars[1] California Community Colleges ID for student
* @param &bindVars[2] STRM
* @Returns first matching row (if any), empty array if not found
*/
method getList
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 2 Then
      Error "bindVars should have 2 elements when listing FA Units";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_FA_UNT_STG_LST, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 30;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve Course Exchange FA Unit data from a staging table
* 
* @param &bindVars[1] California Community Colleges ID for student
* @param &bindVars[2] STRM
* @param &bindVars[3] Mis Code for the External District/College
* @param &bindVars[4] C-ID for the course
* @Returns first matching row (if any), empty array if not found
*/
method getStudentUnits
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 4 Then
      Error "bindVars should have 4 elements when getting FA Units";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "misCode is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "c_id is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_FA_UNT_STG_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      Local number &maxRows = 1;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;
         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* insert Course Exchange FA Units data into a staging table
* 
* @param &bindVars array of data to insert into the staging table
* @Returns 2d array with rows affected in first row, first column
*/
method setStudentUnits
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 8 Then
      Error "bindVars should have 8 elements when setting FA Units";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_FA_UNT_STG_SET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));
end-method;

/**
* This function provides an interface to the College Adaptor to 
* remove Course Exchange FA Units data from a staging table
* 
* @param &bindVars[1] California Community Colleges ID for student
* @param &bindVars[2] STRM
* @param &bindVars[3] Mis Code for the External District/College
* @param &bindVars[4] C-ID for the course
* @Returns 2d array with rows affected in first row, first column
*/
method removeStudentUnits
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 4 Then
      Error "bindVars should have 4 elements when removing FA Units";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "mis code is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "c_id is required";
   End-If;

   Local SQL &sql = GetSQL(SQL.CCTC_FA_UNT_STG_RMV, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error "SQL Status not ok [" | String(&sql.Status) | "]";
   End-If;
   Local number &rowsAffected = &sql.RowsAffected;
   &sql.Close();
   Return CreateArray(CreateArrayAny(&rowsAffected));
end-method;
